    data: |
      SELECT col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 87 * - col2 * ( col1 ) BETWEEN - - col0 AND ( col1 ) AND 94 * 63 IS NOT NULL;
  - name: tab2

outputs:
  - name: q11175.out
    data: |
